import React from 'react'; 
import {Fade} from 'react-reveal';

import '../styles/Cover.css'; 

const WorkshopsCover = (props) => {
    return (
        <React.Fragment>
            <Fade left>
                <h1 id="aboutCover">Workshops</h1>
            </Fade>
        </React.Fragment>
    )
}

export default WorkshopsCover;
